  my ($name,$longname,$tokenid,$decay,$fullshell,$outershell,$rarity,$stability,$electro) = @$item;

  my $hexid=sprintf("%064s", substr($tokenid->as_hex(),2));

  push @b0, qq/let otomnames["$longname"]/     . qq/="$name"\n/;
  push @b1, qq/let otomnames["$name"]/         . qq/="$longname"\n/;
  push @b2, qq/let hexdict["$longname"]/       . qq/="$hexid"\n/;
  push @b3, qq/let hexdict["$name"]/           . qq/="$hexid"\n/;
  push @b4, qq/let hexdict["$hexid"]/          . qq/="$longname"\n/;
  push @b5, qq/let hexdictabbr["$hexid"]/      . qq/="$name"\n/;
  push @b6, qq/let otomdict["$tokenid"]/       . qq/="$longname"\n/;
  push @b7, qq/let otomdictabbr["$tokenid"]/   . qq/="$name"\n/;
  push @b8, qq/let otom2tokenid["$longname"]/  . qq/="$tokenid"\n/;
  push @b9, qq/let otom2tokenid["$name"]/      . qq/="$tokenid"\n/;
  push @b10,qq/let otomsortorder["$longname"]/ . qq/="$counter"\n/;
  push @b11,qq/let otomsortorder["$name"]/     . qq/="$counter"\n/;

  push @b12, sprintf(qq/let decaydict["%s"]=%-26s | let decaydict["%s"]=%s\n/,          $longname, $decaytext{$decay}, $name, $decaytext{$decay});
  push @b13, sprintf(qq/let stabilitydict["%s"]="%s" | let stabilitydict["%s"]="%s"\n/, $longname, $stability,         $name, $stability);
  push @b14, sprintf(qq/let   electrodict["%s"]="%s" | let   electrodict["%s"]="%s"\n/, $longname, $electro,           $name, $electro);

  my $re_name     = $name;
  my $re_longname = $longname;
  $re_name     =  qq{/\\<$name\\>/};
  $re_longname =~ s/^\s*//;
  $re_longname =~ s/\s+/\\s\\+/g;
  $re_longname =  qq{/\\<$re_longname\\>/};

  push @b15, sprintf("syn match rarity_%-8s %-22s | syn match rarity_%-8s %-22s\n", $rarity, $re_longname, $rarity, $re_name);
  push @b16, sprintf("syn match %-26s %-22s | syn match %-26s %-22s\n", $decaystuff{$decay}, $re_longname, $decaystuff{$decay}, $re_name);

  push @b17, sprintf(qq/let     shelldict["%s"]="%s" | let     shelldict["%s"]="%s"\n/, $longname, $outershell,        $name, $outershell);
  push @b18, sprintf(qq/let shelldictlong["%s"]="%s" | let shelldictlong["%s"]="%s"\n/, $longname, $fullshell,         $name, $fullshell);

  $counter++;
}

